connecting mongodb model to apollo-server 2.0<p>I am following a tutorial which uses mongo database with graphql, currently the tutor uses apollo-server v1 but I am using apollo-server v2, the problem I'm having is where do i make the connection of my models to graphql,</p>

<pre><code>const express = require("express");
const mongoose = require("mongoose");
const bodyParser = require("body-parser");
const cors = require("cors");
require("dotenv").config({ path: "variables.env" });
const Recipe = require("./models/Recipe");
const User = require("./models/User");

// Bring in GraphQL-Express middleware
const { graphiqlExpress, graphqlExpress } = require("apollo-server-express");
const { makeExecutableSchema } = require("graphql-tools");

const { typeDefs } = require("./schema");
const { resolvers } = require("./resolvers");

// Create schema
const schema = makeExecutableSchema({
  typeDefs,
  resolvers
});

// Connects to database
mongoose
  .connect(process.env.MONGO_URI)
  .then(() =&gt; console.log("DB connected"))
  .catch(err =&gt; console.error(err));

// Initializes application
const app = express();

const corsOptions = {
  origin: "http://localhost:3000",
  credentials: true
};
app.use(cors(corsOptions));

// Create GraphiQL application
app.use("/graphiql", graphiqlExpress({ endpointURL: "/graphql" }));

// Connect schemas with GraphQL
app.use(
  "/graphql",
  bodyParser.json(),
  graphqlExpress({
    schema,
    context: {
      Recipe,
      User
    }
  })
);

const PORT = process.env.PORT || 4444;

app.listen(PORT, () =&gt; {
  console.log(`Server listening on PORT ${PORT}`);
});
</code></pre>

<p>so in apollo-server v1 you pass in your mongo schema (models) in graphqlExpress</p>

<pre><code> Connect schemas with GraphQL
    app.use(
      "/graphql",
      bodyParser.json(),
      graphqlExpress({
        schema,
        context: {
          Recipe,
          User
        }
      })
    );
</code></pre>

<p>but in v2 you no longer use graphqlExpress function,</p>

<p><a href="https://www.apollographql.com/docs/apollo-server/v2/migration-two-dot.html" rel="nofollow noreferrer">https://www.apollographql.com/docs/apollo-server/v2/migration-two-dot.html</a></p>

<p>so how/where do i pass in my database models to?</p>

<p>currently I have this</p>

<pre><code>const express = require ('express')
const mongoose = require ('mongoose')
const { ApolloServer } = require('apollo-server-express');

require('dotenv').config({path: 'variables.env'})

// mongo schemas/models
const Recipe = require('./models/Recipe')
const User = require('./models/User')

//Graphql schema
const {typeDefs} = require('./schema')
const {resolvers} = require('./resolvers')

// connects to database
mongoose.connect(process.env.MONGO_URI, {useNewUrlParser: true} )
.then(()=&gt; console.log('DB connected'))
.catch(error =&gt; console.log(error))

const PORT = process.env.PORT || 4444;

const server = new ApolloServer({ typeDefs, resolvers });

const app = express();
server.applyMiddleware({ app });

app.listen({ port: PORT }, () =&gt;
  console.log(` Server ready at http://localhost:${PORT}${server.graphqlPath}`)
)
</code></pre>

