Dates are stored as Strings, using an NSDate Extension :
    public class func fromDatatypeValue(stringValue: String) -> NSDate {
        return SQLDateFormatter.dateFromString(stringValue)!
    }
    public var datatypeValue: String {
        return SQLDateFormatter.stringFromDate(self)
    }


    public class func mySQLToSQLiteString (stringValue : String) -> String {
        return stringValue.substringToIndex(advance(stringValue.startIndex, 19)) + ".000"
    }

