Mongo query array.length within an array<p>I tried to use length on an array that is within another array and got an error:</p>

<pre><code>db.quotes.find( { $where: "this.booksWithQuote.authors.length&gt;0" } ) 
// fails with this.booksWithQuote.authors is undefined
</code></pre>

<p>I'm basing this syntax on this example <a href="https://shekhargulati.com/2013/01/24/mongodb-query-tip-find-all-the-documents-where-array-length-is-greater-than-n/" rel="nofollow noreferrer">MongoDB  find all documents where an array / list size is greater than N</a> that works:</p>

<pre><code>db.domain.find( {booksWithQuote: {$exists:true}, $where:'this.booksWithQuote.length&gt;0'} )
// Above works
</code></pre>

<p>So I'm wondering if this is possible, <strong>how can I find all documents that have array1.array2 where array2 length is greater than zero.</strong></p>

<p>I've tried the following but it fails with a syntax error:</p>

<pre><code>db.quotes.find( { 
  "booksWithQuote": {$exists: true} },
  "booksWithQuote.authors": {$exists: true} },
  $where: "booksWithQuote.authors.length&gt;0" } ) 
// fails with this.booksWithQuote.authors is undefined
</code></pre>

<p>It's worth pointing out that if I knew the author of a book, the nested array with array searching worked.  Pretty cool!</p>

<pre><code>db.quotes.find( { "booksWithQuote.authors" : "Sam Fisher" } ) 
// Returns all quotes that have a book that has the author Sam Fisher
</code></pre>

<p>But in my case <strong>I'm just trying to find all of the quotes that have more than one author on any given book.</strong></p>

<p>To follow along, consider this example.</p>

<p>I have a collection of quotes, and each quote has a list of books where the quote was used, and each book has an array of authors.</p>

<p>Below is some sample data so you can understand the structure of the data.  It shows one quote with no books, another quote with a book but no authors, and a third quote with books and several authors.</p>

<p><code>
[
  {
    quoteText: "Love to code",
    booksWithQuote: [ ]
  },
  {
    quoteText: "Another Quotesake",
    booksWithQuote: [
      {
        title: "Where is elmo",
        authors: [ ]
      }
    ]
  },
  {
    quoteText: "For goodness sake",
    booksWithQuote: [
      {
        title: "The search for Elmo",
        authors: [ 
          "John Smith",
          "Sam Fisher",
          "Jim Wiggins"
        ]
      },
      {
        title: "Finding Elmo",
        authors: [ "Sam Fisher" ]
      },
      {
        title: "Mercy me",
        authors: [ ]
      }
    ]
  }
]
</code></p>

<p>So to reiterate, <strong>How can I find all documents that have an array within another array where the 2nd array has one or more elements?</strong></p>

