How to compare 2 collections and fetch matched field data in mongodb?<p>I have a two collection as given below.</p>

<p>Collection 1: <strong>List</strong></p>

<pre><code>{
"_id" : ObjectId("5b618589d6edcc135c1aee0a"),
"name" : "ABC",
"special" : "Golmal",
"dim" : "2122",
}
</code></pre>

<p>Collection 2: <strong>Data</strong></p>

<p>Document 1:</p>

<pre><code>{
"_id" : ObjectId("5b6023d9589ff6bfb5dd75d7"),
"date" : "2018/08/13",
"special" : "Golmal",
}
</code></pre>

<p>Document 2:</p>

<pre><code>{
"_id" : ObjectId("5b602447589ff6bfb5dd7606"),
"date" : "2018/08/13",
"special" : "Godman",
}
</code></pre>

<p>Here I want compare both the collection and if <code>"special":"Golmal"</code> of Collection 1 is present in Collection 2 documents I want to display/fetch all the related date from Collection 1 document.</p>

<p>I have tried <code>aggregate</code> &amp; <code>$lookup</code> as below</p>

<pre><code>getAvailableList(): Promise&lt;any&gt; {
    return this._mongoUtility.Db
        .then(db =&gt; {
            let list= db.collection('list');
            let data= db.collection('data');           
            list.aggregate([{$lookup:
                {
                    from: data,
                    localField: "special",
                    foreignField: "special",
                    as: "matches"
                }
            },
                {
                    $match: { "matches": { $ne: [{}] } }
                }
            ]);
            return Promise.resolve();
        })
        .catch(err =&gt; {
            return Promise.reject({message: 'Not found', err: err});
        });
}
</code></pre>

<p>But I'm getting null.</p>

<p>I have also tied by using <code>.find</code> &amp; <code>forEach</code> as below</p>

<pre><code> let abc = [];
            list.find({}).toArray()
                .then(arr =&gt; {
                    arr.forEach(obj1 =&gt; {
                        data.find({special: obj1.special}).toArray()
                            .then(secondArr =&gt; {
                                console.log(secondArr);
                                if (secondArr.length &gt; 0) {
                                    abc.push(obj1);
                                }
                            });
                    });
                });
            return Promise.resolve();
</code></pre>

<p>But no result. I need value in JSON format. As MongoDB dont have joins. Is there any ways to crack it?</p>

