How to access two Mongo databases within one Angular application?<p>At the moment I am running a MEAN stack application that is using one Mongo database called <code>mydb-1</code>.</p>

<p>I'm running this on localhost and on my command line, I am running the following:</p>

<p><code>node bin\www --mongoURL mongodb://localhost:27017/mydb-1</code></p>

<p>In addition to this Mongo database - <code>mydb-1</code> I now need to access another Mongo database called <code>mydb-2</code> within the same application.</p>

<p>Up until now, I have been using the above command line statement to access mydb-1.</p>

<p>What do I now need to do, inorder for my application to also see both mydb-1 and mydb-2 Mongo databases, when it comes to the command line, i.e.:</p>

<p><code>node bin\www --mongoURL mongodb://localhost:27017/mydb-1, mydb-2</code></p>

<p>At the moment, I am using the npm package express-mongo-db over at:</p>

<p><a href="https://www.npmjs.com/package/express-mongo-db" rel="nofollow noreferrer">https://www.npmjs.com/package/express-mongo-db</a></p>

<p>where my mongodb connection is made.</p>

<p>My code is similar to the following for one mongo database.</p>

<pre><code>var app = require('express');

var expressMongoDb = require('express-mongo-db');
app.use(expressMongoDb('mongodb://localhost:27017/mydb-1'));

app.get('/', function (req, res, next) {
    req.db // =&gt; Db object
});
</code></pre>

